  false,\n\t\"url\": null,\n\t\"notes\": \"The Muscatatuck NWR Fur Management Plan
  directs the management and regulation of trapping. The plan provides a description
  of the Refuge, describes the relation of trapping to Refuge objectives, assesses
  the trapping desirability of the Refuge, and describes the trapping program. Furbearers
  included in this plan are muskrat, mink, raccoon, and beaver. A sample permit application
  and permit are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
